import React from "react"
import './RenderSubscribedDetails.css'
import { toast } from "react-toastify";

function RenderObject(props) {
    return (
        <tbody>
            {
                props.details.map(request => {
                    return (
                        <tr key={request}>
                            <td >
                                <span>{request}</span>
                            </td>
                            <td>
                                <span>props.details[request]</span>
                            </td>
                            <td>
                                <button
                                    className="btn btn-outline-danger"
                                    onClick={() => {
                                        const min = 1000;
                                        const max = 100000000;
                                        const rand = Math.floor(min + Math.random() * (max - min));
                                        console.log(rand)
                                        // props.createNewChannel(rand, request.address).then(() => {
                                        //     // Add Channel Id in List
                                        //     // set default state as an last state
                                        //     // set listening socket from UserList 
                                        //     toast.success("Channel Created with id " + rand);
                                        // });
                                    }}
                                >
                                    CreateChannel
                                </button>
                            </td>
                            <td>request.name</td>
                            <td>request.address</td>
                            <td>request.category</td>
                            <td>request.listen</td>
                        </tr>
                    )

                }
                )
            }
        </tbody>
    )
}

function RenderSubscribedDetails(props) {

    return (
        <div>
            <table id="table" className="table">
                <thead>
                    <tr>
                        <th>Type</th>
                        <th>value</th>
                    </tr>
                </thead>
                <RenderObject details={props.details} />
            </table>
        </div>
    )
}

export default RenderSubscribedDetails;
